import React, {useState} from 'react';

// material-ui
import {makeStyles} from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField';
import Button from '@material-ui/core/Button';
import Grid from '@material-ui/core/Grid';
import Dialog from '@material-ui/core/Dialog';
import DialogActions from '@material-ui/core/DialogActions';
import DialogContent from '@material-ui/core/DialogContent';
import DialogContentText from '@material-ui/core/DialogContentText';
import Slide from '@material-ui/core/Slide';

// css
import './Contact.css';

// material-ui-styles
const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
    '& .MuiOutlinedInput-root': {
      '& fieldset': {
        borderColor: '#FCEFFF',
      },
      '&:hover fieldset': {
        borderColor: '#FCEFFF',
      },
      '&.Mui-focused fieldset': {
        borderColor: '#FCEFFF',
      },
    },
  },
  container : {
    marginTop:'70px',
    marginBottom:'70px',
  },
  beeContainer:{
    position:'relative',
  },
  form: {
    padding:55,
    backgroundColor:'#FCEFFF',
  },
  inputStyle: {
    width:'100%',
    marginBottom:15,
    backgroundColor:'white',
  },
  btnStyle: {
    width:'100%',
    color:'white',
    backgroundColor:'#A53BBA',
    '&:hover': {
      backgroundColor:'#A53BBA',
    },
    textTransform:'capitalize'
  }
}));

const Transition = React.forwardRef(function Transition(props, ref) {
  return <Slide direction="up" ref={ref} {...props} />;
});

export default function Contact() {
  const classes = useStyles();
  const [open, setOpen] = React.useState(false);
  const handleClickOpen = () => {
    setOpen(true);
  };
  const handleClose = () => {
    setOpen(false);
    window.location.reload();
  };
  
  return (
    <div className={classes.root}>
      <div className="center">
      <div>
        <Dialog
          open={open}
          TransitionComponent={Transition}
          keepMounted
          onClose={handleClose}
          aria-labelledby="alert-dialog-slide-title"
          aria-describedby="alert-dialog-slide-description"
          style={{padding: 20}}
        >
          <DialogContent>
            <DialogContentText id="alert-dialog-slide-description">
              Thank you for your interest! We will contact you soon.
            </DialogContentText>
          </DialogContent>
          <DialogActions>
            <Button onClick={handleClose} style={{color:'#A53BBA'}}>
              Close
            </Button>
          </DialogActions>
        </Dialog>
        </div>
        <div className="sub_title">
            <h1>Contact Us</h1>
            <p>Like Kovan? Or have a question for the Kovan team?<br />
            And how the application can work for your group or team? <br />
            <span style={{fontWeight:'bold'}}>Reach Out To Us!</span></p>
        </div>
        <Grid container spacing={3} className="container">
          <Grid item sm={5} xs={12} className={classes.beeContainer}>
          <svg className="bee2" xmlns="http://www.w3.org/2000/svg"  xmlnsXlink="http://www.w3.org/1999/xlink" width="190" height="271" viewBox="0 0 190 271">
            <image id="AvatarMove" width="190" height="271" xlinkHref="data:image/png;base64,"/>
          </svg>
          </Grid>
          <Grid item sm={7} xs={12}>
          <div className={classes.form}>
            <TextField
              className={classes.inputStyle}
              id="outlined-size-normal"
              placeholder="Your Name"
              variant="outlined"
            />
            <TextField
              className={classes.inputStyle}
              id="outlined-size-normal"
              placeholder="Your E-mail"
              variant="outlined"
            />
            <TextField
              className={classes.inputStyle}
              id="outlined-multiline-static"
              multiline
              rows={4}
              placeholder="Your Message"
              variant="outlined"
            />
            <Button 
              variant="contained" 
              className={classes.btnStyle}
              onClick={handleClickOpen}
            >
              Send
            </Button>
          </div>
          </Grid>
        </Grid>
      </div>
    </div>
  );
}
